INSERT INTO `place` VALUES (0,300,'PK_DOCTOR_0','Quốc LLC','Đồng mười ờ núi kim không hai ruộng.\nBạn ờ phá biết.\nĐang viết phá.\nNước việc xe biển mây con biết phá.\nRuộng vẽ tàu ác hóa máy thôi.\nĐâu trời đánh vẽ biết trăng áo.','Leo thích tàu.','0115 199 8882','Ng.T42@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(1,301,'PK_DOCTOR_1','Khoa - Loan','Đá hàng quần khoan á.\nTô quê ghế năm cửa á nước.\nChìm đạp xuồng viết hai thuê.\nBảy tô trời đang bốn hết kim quần lầu tím.','Chìm phá không đỏ chín đập nghỉ.','0101 139 3872','Hong49@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(2,302,'PK_DOCTOR_2','Hà - Bửu','Máy hóa thuê thích đã đạp tàu hai.\nLỗi vàng mây giết bạn là hết á kim.\nChỉ đang vàng đỏ máy ghét.\nTôi bè con phá nghỉ mười trăng bốn nón.\nSáu đỏ vàng lỗi thôi chìm.\nQuần viết em dép vàng năm xe á bơi chín.','Đồng một đánh vá vàng ừ thì tô bốn.','016977 7984','L_Tho@hotmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(3,303,'PK_DOCTOR_3','Dương Inc','Ruộng ba xuồng con chìm độc thôi mười thì làm.\nMười bảy bơi đánh mây năm giết.\nĐỏ thương áo mây độc bàn thuê nha hết.\nHàng vá tui.\nChết tôi ừ khoan biết trăng phá.\nTủ ruộng đâu được thích không đập đạp núi.','Khoan viết lỗi máy chín mua ghế kim.','0388 586 0338','Tng_Hin42@hotmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(4,304,'PK_DOCTOR_4','Mai - Hà','Tàu lỗi bàn ghét vẽ ba đâu đánh được tủ.\nNăm tui quần tôi.\nMười cửa em bơi là.','Hóa là mười tô may thôi.','0308 479 7312','Ng.Tho@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(5,305,'PK_DOCTOR_5','Trịnh, Đỗ and Phú','Bảy ba không giày mua con gì năm quê leo.\nGiày bàn núi giết tui.\nCửa ghế khoan vẽ tám.','Ghế chết cửa chìm tui đỏ đánh bè bàn.','01490 81767','L_Ph16@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(6,306,'PK_DOCTOR_6','Phú - Tăng','Xuồng quê á chín bè ờ đồng quần.\nMột tím mướn chết thuê em bốn.\nÁo hết đã phá độc không chỉ quần đạp khoan.\nHàng bàn ba bốn trăng thuyền biển áo thế bảy.\nĐồng thuyền hai đánh bạn việc yêu nón ghế dép.\nBè tủ chết cửa chìm thì độc.','Ngọt khoan cửa nhà thương.','01098 34937','on_Vng23@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(7,307,'PK_DOCTOR_7','Vũ, Lâm and Hồ','Yêu khâu sáu leo bạn.\nCái bè thôi nghỉ đánh khâu đang hóa.\nChìm áo năm chỉ giày tàu núi ruộng con độc.\nMột nghỉ ghế đánh.\nĐá kim bè đánh thế.\nMây bốn xuồng quê lầu bè.','Gì áo việc vàng nha.','055 3037 7177','L.@hotmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(8,308,'PK_DOCTOR_8','Hữu, Vinh and Cường','Cửa bốn mượn ba giết được thế.\nNghỉ giày đâu đồng chín khoan bơi.\nRuộng làm gió đạp thuê mướn máy.\nHết vẽ xuồng đang xe.\nXe vẽ đang thôi bàn chìm em yêu.\nMay mua nha thuyền dép được cái lỗi nước.','Tím khoan con cửa em hàng.','056 6445 7181','Phm.V@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(9,309,'PK_DOCTOR_9','Tú and Sons','Nghỉ thích sáu làm trăng không.\nLầu anh con leo.\nNúi hai thương tủ việc khâu ruộng.\nHết hóa leo chín mười em bè lầu tô.\nXuồng leo ác chỉ là kim quê.','Ruộng việc nha lầu.','01013 94035','Phng_Nh46@hotmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(10,310,'PK_DOCTOR_10','Thắgn, Phong and Sinh','May được nón giày tôi chín.\nMột chìm ghét giày được.\nMột cửa anh khâu.\nMây chết áo.\nTrời bốn con đỏ.','Đã á xanh đâu nha xuồng ghét giày bơi.','0946 305 8336','Trng_Kim87@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(11,311,'PK_DOCTOR_11','Thu - Thắm','Mười xe bạn đâu xuồng tủ mượn.\nTôi bốn khoảng trăng xuồng làm.\nMười ghế biển kim ờ.\nLầu tô là thương mượn em.\nHóa đánh ác trời may khoan đâu quê.','Tui hóa trăng tô nha ờ mượn là.','055 8494 0405','inh58@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(12,312,'PK_DOCTOR_12','Loan, Phan and Vũ','Tám đâu bốn bè xanh đá chín chết hóa đang.\nTám vàng mượn cửa đã hai kim quần bốn.\nÁc thuyền thế nước khoan quê nghỉ tím.\nBiết đâu ừ thì được bốn cửa xe.\nĐánh ruộng tàu trăng chết cửa mướn yêu.\nỜ đang được xe ghét làm yêu việc ba mua.','Xe quần nghỉ anh quê khâu đá leo chết.','0101 610 5639','Phan31@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(13,313,'PK_DOCTOR_13','Khang - Tăng','Cửa kim vẽ áo cái đập.\nGhế chết giết biển hóa yêu hai gió.\nTàu sáu ghét biển.\nXanh anh yêu ngọt thích thuê bốn viết.\nNước xuồng xe ngọt tám vá á gió bạn cái.','Đạp mướn hết.','01705 54086','V10@gmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(14,314,'PK_DOCTOR_14','Nhân - Đặng','Quê mượn áo.\nThương thôi kim may quần.\nĐã tô đánh.\nĐược ruộng viết hết khoảng chín tui yêu hóa lầu.\nHóa bàn biết.\nBa việc vàng thuyền bảy chỉ bốn nón em nhà.','Chìm một bốn.','027 1230 4532','Dng50@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(15,315,'PK_DOCTOR_15','Văn Group','Nha hóa mười được.\nBàn tủ đồng giày.\nBàn không quê.\nGì việc nhà núi đã thôi nghỉ đánh giết.\nNước đá không ba đỏ hết.\nKhâu quê hóa.','Ba đang mây.','0800 533 9867','Ng_Cng@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(16,316,'PK_DOCTOR_16','Thu, Đặng and Hoàng','Gió lỗi giày bàn đã thế thuyền con bơi quê.\nKhông sáu thuyền may lầu yêu nhà đá nước ờ.\nDép cửa nhà tui trăng đâu.\nNước nón mười đã.\nĐược phá đạp cái kim dép là chỉ yêu mây.\nGió chín tám lỗi nha là không.','Viết bàn bạn giết đang vàng quê.','01318 97698','Phm45@hotmail.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(17,317,'PK_DOCTOR_17','Nam Inc','Bơi biển viết khoảng đang gì xanh đạp thì đá.\nTàu bơi cửa mượn lầu ba ờ.\nBảy ba sáu bàn đã bạn ghế nón bè phá.\nLầu bảy đạp là bè trăng cửa con.','Được tủ ba bốn bè mướn lỗi cái giày.','0843 807 0108','Ng95@yahoo.com',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(18,318,'PK_DOCTOR_18','Trần, Khoa and Phùng','Năm đồng tôi bè đánh hóa thuyền máy núi đã.\nTám em chín thương hai.\nLà gió mười vàng chỉ.\nLỗi ghế may ác chỉ trời.','Mượn viết vẽ bảy ghế.'